function Input() {
    return (
        <section >
        <div className='row'> 
        <div className ="cell"> <input type="text" name='english'></input></div>
        <div className ="cell">  <input type="text" name='transcription'></input></div>
        <div className ="cell"></div>   <input type="text" name='russian'></input></div>
        <div className ="cell"> <input type="text" name='boolean'></input></div>
        <div className ="cell"></div>  <button className= 'btn_save'>Save</button>
        <div className ="cell">   <button className= 'btn'></button>
       </div>
       </section>
    );
}
export default Input
